import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Authorization from './Authorization';
import PhoneCodeRegistration from './Pages/PhoneCodeRegistration';
import Registration from './Pages/Registration';

const NavigationForSettings = () => {
    return (
      <>
        <Stack.Navigator
          initialRouteName="Settings"
          screenOptions={{
            headerShown: false, 
            
          }}
        >
          <Stack.Screen name="Settings" component={Settingspage} />
          <Stack.Screen name="Saved message" component={SavedmessagePage} />
          <Stack.Screen name="Edit page" component={EditPageNavigator} />
          <Stack.Screen name="Question page" component={QuestionPage} />
          <Stack.Screen name="Chat folders" component={ChatFolderPageNAvigator} />
          <Stack.Screen name="Confidentiality" component={ConfidentialityPageNavigator} />
        </Stack.Navigator>
      </>
    );
  };
  
  const ConfidentialityPageNavigator=()=> {
    return (
      <Stack.Navigator
      initialRouteName="ConfidentialityPage"
      screenOptions={{
        headerShown: false,
      }}
    >
        <Stack.Screen name="ConfidentialityPage" component={ConfidentialityPage} />
        <Stack.Screen name="BlockUsers" component={BlockUser} />
        <Stack.Screen name="PasswordPage" component={PasswordPage} />
      </Stack.Navigator>
    );
  }
  const EditPageNavigator=()=> {
    return (
      <Stack.Navigator
      initialRouteName="EditPage"
      screenOptions={{
        headerShown: false,
      }}
    >
        <Stack.Screen name="EditPage" component={EditPage} />
        <Stack.Screen name="EditBioPage" component={EditBioPage} />
        <Stack.Screen name="EditUsernamePage" component={EditUsernamePage} />
      </Stack.Navigator>
    );
  }
  
  const ChatFolderPageNAvigator=()=> {
    return (
      <Stack.Navigator
      initialRouteName="Chatfolders"
      screenOptions={{
        headerShown: false,
      }}
    >
        <Stack.Screen name="Chatfolders" component={ChatFolderPage} />
        <Stack.Screen name="AddFolderPage" component={AddFolderPage} />
      </Stack.Navigator>
    );
  }
  
  export default NavigationForSettings;

const NavigationForAuthorization = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator
        initialRouteName="Authorization"
        screenOptions={{ headerShown: false }}
      >
        <Stack.Screen name="Authorization" component={Authorization} />
        <Stack.Screen
          name="PhoneCodeRegistration"
          component={PhoneCodeRegistration}
        />
        <Stack.Screen name="Registration" component={Registration} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default NavigationForAuthorization;
